import React, { Component } from "react";
import Post from "./Post";

export default class Presentation extends Component {
  render() {
    const presentation = this.props.presentation;
    return (
      <div className="post">
        {presentation.map(item => {
          return <Post />;
        })}
      </div>
    );
  }
}
